// 使用本拓展造成的任何后果与开发者无关。
// ——————不重要的——————————
// 解释一下拓展id为什么用的是rig（直译：装置）而不是操纵：
// 因为操纵的英语太长了，不便于直接书写，所以用rig来代替。

(() => {
    // src/index.ts
    (function(Scratch2) {
      const WindowRigIconUrl = "data:image/svg+xml;base64,";
      const WindowRigPictureUrl = `data:image/jpeg;base64,`;
      if (Scratch2.extensions.unsandboxed === false) {
        throw new Error("Sandboxed mode is not supported");
      }
      Scratch2.translate.setup({
        "zh-cn": {
          "WindowRig.name": "\u5578\u5929\u72AC\u7684window\u64CD\u4F5C",
          "WindowRig.windowTitle": "\u4FEE\u6539\u7F51\u9875\u6807\u9898\u4E3A[title]",
          "WindowRig.ico": "\u4FEE\u6539\u7F51\u9875ico\u94FE\u63A5\u4E3A[icoUrl]\uFF08\u652F\u6301dataurl\uFF09",
          "WindowRig.sctollBy": "\u5C06\u9875\u9762\u5411x\u8F74\u6EDA\u52A8[x]\u50CF\u7D20\uFF0C\u5411y\u8F74\u6EDA\u52A8[y]\u50CF\u7D20",
          "WindowRig.sctollTo": "\u5C06\u9875\u9762\u6EDA\u52A8\u81F3\u6D4F\u89C8\u5668\u5750\u6807x[x]y[y]"
        },
        en: {
          "WindowRig.name": "Skydog's window rig",
          "WindowRig.windowTitle": "Change the title of the webpage to [title]",
          "windowRig.ico": "Change the ico link of the webpage to [icoUrl] (support dataurl)",
          "WindowRig.sctollBy": "Scroll the page by [x] pixels on the x-axis and [y] pixels on the y-axis",
          "WindowRig.sctollTo": "Scroll the page to the browser coordinate x[x]y[y]"
        }
      });
      function i10n(id) {
        return Scratch2.translate({ id, default: id, description: id });
      }
      class WindowRig {
        runtime;
        constructor(runtime) {
          this.runtime = runtime;
        }
        getInfo() {
          return {
            id: "WindowRig",
            name: i10n("WindowRig.name"),
            color1: "#323fa1",
            color2: "#323fa1",
            blockIconURI: WindowRigIconUrl,
            menuIconURI: WindowRigIconUrl,
            blocks: [
              {
                blockType: Scratch2.BlockType.COMMAND,
                opcode: "windowTitle",
                text: i10n("WindowRig.windowTitle"),
                arguments: {
                  title: {
                    type: Scratch2.ArgumentType.STRING,
                    defaultValue: "Hello-Word"
                  }
                }
              },
              {
                blockType: Scratch2.BlockType.COMMAND,
                opcode: "ico",
                text: i10n("WindowRig.ico"),
                arguments: {
                  icoUrl: {
                    type: Scratch2.ArgumentType.STRING,
                    defaultValue: "https://www.ccw.site/favicon.ico"
                  }
                }
              },
              {
                blockType: Scratch2.BlockType.COMMAND,
                opcode: "sctollBy",
                text: i10n("WindowRig.sctollBy"),
                arguments: {
                  x: {
                    type: Scratch2.ArgumentType.NUMBER,
                    defaultValue: 100
                  },
                  y: {
                    type: Scratch2.ArgumentType.NUMBER,
                    defaultValue: 100
                  }
                }
              },
              {
                blockType: Scratch2.BlockType.COMMAND,
                opcode: "sctollTo",
                text: i10n("WindowRig.sctollTo"),
                arguments: {
                  x: {
                    type: Scratch2.ArgumentType.NUMBER,
                    defaultValue: 100
                  },
                  y: {
                    type: Scratch2.ArgumentType.NUMBER,
                    defaultValue: 100
                  }
                }
              }
            ]
          };
        }
        //extension's code here
        windowTitle(args) {
          const title = args.title;
          document.title = title;
        }
        ico(args) {
          const icoUrl = args.icoUrl;
          const link = document.querySelector("link[rel*='icon']") || document.createElement("link");
          link.type = "image/x-icon";
          link.rel = "shortcut icon";
          link.href = icoUrl;
          document.getElementsByTagName("head")[0].appendChild(link);
        }
        sctollBy(args) {
          const x = args.x;
          const y = args.y;
          window.scrollBy(x, y);
        }
        sctollTo(args) {
          const x = args.x;
          const y = args.y;
          window.scrollTo(x, y);
        }
      }
      window.tempExt = {
        Extension: WindowRig,
        info: {
          name: "WindowRig.name",
          description: "WindowRig.descp",
          extensionId: "WindowRig",
          iconURL: WindowRigPictureUrl,
          insetIconURL: WindowRigIconUrl,
          featured: true,
          disabled: false,
          collaborator: "\u591Abug\u7684\u5578\u5929\u72AC @ CCW"
        },
        l10n: {
          "zh-cn": {
            "WindowRig.name": "\u5578\u5929\u72AC\u7684window\u64CD\u7EB5",
            "WindowRig.descp": "\u64CD\u7EB5window\u5BF9\u8C61\uFF01\u8BBE\u7F6E\u9875\u9762\u56FE\u6807\uFF01"
          },
          en: {
            "WindowRig.name": "Skydog's window rig",
            "WindowRig.descp": "Manipulate the window object! Set the page icon!"
          }
        }
      };
    })(Scratch);
  })();
  